import React from "react"

function Header(props) {
  const logo = (
    <img
      src="F:\Projects\Extra\p-keep\src\components\img\Untitled.png"
      alt="My-logo"
    />
  )
  return (
    <div className="header">
      {logo}
      <h3>Keep</h3>
    </div>
  )
}

export default Header
